import React from "react";
import { Link } from "react-router-dom";
import { Col, Container, Row } from "react-bootstrap";
const Move = () => {
    return (
        <div>
            <hr style={{ marginTop: 100 }} />
            <Container>
                <Row>
                    <Col>
                        <div style={{ margin: 30 }}>한이음 프로젝트 우아마켓 </div>
                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default Move;
